import React from 'react';
import '../styles/Finished.css';

function FinishedHeader() {
        return (
            <div className="Finished">
                <header className="Finished-header">
                    <h1>
                        Finished
                    </h1>
                    <div>
                        Список сделанного
                    </div>
                </header>
            </div>
        );
}

export default FinishedHeader;
